import React from 'react';


const FooterAluno = () => {
    return (
        <Container>
        <footer className='text-center' style={{  
            position : 'static',
            left: 0,
            bottom: 0,
            width: '100%'
        }}>
            <h3> Projeto EDUX </h3>
            <small> Desenvolvido pela dupla de 2 </small>
        </footer>
        </Container>
    )
}

export default FooterAluno;
